B.Jm=new A.dd("Automated, Capital-Efficient Liquidity Provision ENGH utilizes a DLMM (Dynamic Liquidity Market Maker) vault on Meteora to provide deep, efficient liquidity on Solana. The vault dynamically adjusts liquidity across price ranges, ensuring better price execution and reduced slippage for traders.\n\nWhy DLMM?\n\n\u2022  ENGH holders can participate by depositing into the DLMM vault and earn passive yields from trading volume.\n\u2022  Concentrated liquidity for capital efficiency \n\n\u2022  Dynamic bin rebalancing based on market trends \n\n\u2022  Auto-compounding of trading fees for LP providers\n\n\u2022 Reduces impermanent loss through strategic positioning\n\n50 % of Fees. Burned Every Sunday.\n\nENGH features a scheduled buyback and burn mechanism powered by trading activity. 50% of all swap fees collected via Raydium are accumulated in a buyback wallet and used to purchase ENGH from the market. The purchased tokens are then burned every Sunday, reducing total supply and increasing long-term scarcity.\n\nHow it works:\n\n\u2022 50% of Raydium swap fees go to the buyback wallet\n\u2022 Buybacks occur weekly \u2014 every Sunday\n\u2022 ENGH tokens are bought back from the open market\n\u2022 Bought tokens are sent to the burn address, reducing total supply\n\u2022 This creates ongoing price pressure and community value\n\nThis deflationary mechanism increases scarcity and supports long-term price strength.\n\n\u2022 50% of Raydium swap fees are used to buy back ENGH weekly and burn them to reduce supply and increase scarcity.\n\nBuyback Wallet:\n",null,null,B.a7,null)
